import React from 'react';
import { Form, Icon, Input, Button, Checkbox } from 'antd';

const Loans = () => {
    const onSubmit = () => {};

    const onChangeName = () => {};

    const onChangePhone01 = () => {};

    const onChangePhone02 = () => {};

    const onChangePhone03 = () => {};

    const onChangeTerm01 = () => {};
    
    const onChangeTerm02 = () => {};

    const term01 = true;
    const term02 = true;
    return (
        <Form layout="inline" onSubmit={onSubmit} style={{textAlign: 'center', backgrounColor: 'powderblue'}}>
            <Form.Item>
                <label htmlFor="user-name"></label>
                <Input name="user-name" required onChange={onChangeName} style={{width: 100}} placeholder="이름"></Input>
            </Form.Item>
            <Form.Item>
                <label htmlFor="user-phone01"></label>
                <Input name="user-phone01" required onChange={onChangePhone01} style={{width: 100}} placeholder="010" ></Input>
            </Form.Item>
            <Form.Item>
                <label htmlFor="user-phone02"></label>
                <Input name="user-phone02" required onChange={onChangePhone02} style={{width: 100}} placeholder="1234"></Input>
            </Form.Item>
            <Form.Item>
                <label htmlFor="user-phone03"></label>
                <Input name="user-phone03" required onChange={onChangePhone03} style={{width: 100}} placeholder="5678"></Input>
            </Form.Item>
            <div>
                <Checkbox name="user-term01" value={term01} onChage={onChangeTerm01}>[필수] 개인정보 취급방침 ></Checkbox>
            </div>
            <Form.Item>
                <Checkbox name="user-term01" value={term02} onChage={onChangeTerm02}>[필수] 개인(신용)정보 수집,이용 동의 ></Checkbox>
            </Form.Item>
            <br />
            <div>
                <Button type="primary" htmlType="submit">빠른 상담신청하기</Button>
            </div>
            <br />
        </Form>
    )
}

export default Loans;
